const string = '';

checkDups = (input) => {
    const matchFound = input.filter((item, index) => input.indexOf(item) !== index)

    return matchFound;
}

for (let i = 0; i < string.length; i++) {
    const tempArray = string.slice(i, i + 14).split('')

    console.log(checkDups(tempArray).length);

    if (checkDups(tempArray).length === 0) {
        return console.log(i + 14);
    }
}























